import React, { Component } from 'react';

class Users extends Component {
  state = {
    users: [
      {
        id: '1',
        login: 'Bojurie',
        avatar_url: 'https://avatars1.githubusercontent.com/u/40696649?s=460&u=d87164bc4638c32c6166ca46a81de93d6711685e&v=4',
        html_url: 'https://github.com/Bojurie'
      },
      {
        id: '2',
        login: 'defunkt',
        avatar_url: 'https://avatars1.githubusercontent.com/u/2?v=4',
        html_url: 'https://github.com/defunkt'
      },
      {
        id: '3',
        login: 'pjhyett',
        avatar_url: 'https://avatars1.githubusercontent.com/u/3?v=4',
        html_url: 'https://github.com/pjhyett'
      }
    ]

  }
  render() {
    return (
      <div>
        {this.state.users.map(user => (
          <div>{user.login}</div>
         ))}
      </div>
    );
  }
}

export default Users;
